import React from "react";

class Users extends React.Component {
    state = {
        users: []
    } 

    componentDidMount() {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(r => r.json())
            .then(data => {
                this.setState({
                    user: data
                })
            })
    }

    render() {
        return <> 
            <ul>
                {this.state,users.map(user => <li>{user.name}</li>)}
            </ul>
        </>
    }
}

export default Users;
